// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/access/Ownable.sol";
import "../helper/Helper.sol";

contract Tags is Ownable {

    mapping(string => Tag) public TagsMap;
    mapping (address => mapping(string => Tag)) public TagsRequested;
    //Tag[] public TagRequests;
    //event TagRequested(string _tag, string _content, address _requester);
    event TagAdded(string _tag, string _content, address _tager);

    struct Tag {
        string content;
        address tager;
        uint blockNumber;
    }

    modifier _onlyOwner() {
        require(msg.sender == owner(), "Not the owner.");
        _;
    }

    function requestTag(string memory _tag, string memory _content) public payable {
        require(bytes(_tag).length >= 3 && bytes(_tag).length < 65, "Content is empty.");
        require(TagsMap[_tag].tager == address(0), "Tag already exists.");
        require(Helper.isV1RawCID(_content), "Invalid CID.");
        require(msg.value >= 0.001 ether, "Insufficient funds.");
        //TagRequests.push(Tag(_content, msg.sender));
        TagsRequested[msg.sender][_tag] = Tag(_content, msg.sender, block.number);
        //emit TagRequested(_tag, _content, msg.sender);
    }

    function addTag( string memory _tag, Tag memory _Tag) public _onlyOwner {
        TagsMap[_tag] = _Tag;
        emit TagAdded(_tag, _Tag.content, _Tag.tager);
    }

    function removeTag(string memory _tag) public _onlyOwner {
        delete TagsMap[_tag];
    }

    function getValue() public _onlyOwner{
        address payable owner = payable(msg.sender);
        owner.transfer(address(this).balance);
    }
}
